import React from 'react';
import {Link} from 'react-router-dom'
import './css/Home.css'

class Home extends React.Component {
  state = {
    checkLogPas: false,
    menuNavigationHome: true,
    menuNavigationFavorites: false
  }
  signOut = (field) => event => {
    this.setState({ [field]: false })
    delete localStorage["token"]
  }
  changeHome = event => {
    this.setState({menuNavigationHome: true, menuNavigationFavorites: false})
  }
  changeFavorites = event => {
    this.setState({menuNavigationHome: false, menuNavigationFavorites: true})
  }
  render () {
    console.log(this.state.menuNavigationHome)
    console.log(this.state.menuNavigationFavorites)
    return (
      <div className="Home">
        <div className="header">
          <div className="logo">
          </div>
          <div className="linkLayout" checked={this.state.menuNavigationHome} onClick={this.changeHome}>
            <Link to="/" >Главная</Link>
          </div>
          <div className="linkLayout" checked={this.state.menuNavigationFavorites} onClick={this.changeFavorites}>
          abc
          </div>
          <div>
          </div>
          <div>
          </div>
          <div>
            <Link to="/auth" checked={this.state.checkLogPas} onClick={this.signOut("checkLogPas")}>Выйти</Link>
          </div>
          <div>
          </div>
        </div>
        <div className="body">
        </div>
      </div>
    )
  }
}

export default Home;
